script: |
  super -f text -I q11348.spq | sort > q11348.out

inputs:
  - name: q11348.spq
    data: |
      SELECT - - col2 AS col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE col0 NOT BETWEEN - - 9 + - - 22 * 7 AND ( - ( + 84 ) ) * - - ( + 76 ) - + col2;
  - name: tab1

outputs:
  - name: q11348.out
    data: |
      59
      68
      96
